プログラム書く前にwasm32-wasiのターゲットを追加しておきます rustup target add wasm32-wasi 計算するだけのプログラムを書きます. readがホスト環境で実装される関数です. i64にキャストされたポインタが, 実行時にcalc関数に渡されるので, それをreadに渡してあげればホストからデータが取れます. #![no_main] extern { pub fn read(pointer: i64, offset: u8) -> i32;
} #[no_mangle]
pub fn calc(pointer: i64, input: u8) -> i32 { let val = unsafe { read(pointer, 2) }; input as i32 + val
} コンパイルします. そのままじゃ"read"の実装がないやんけ！って怒られるので, --emit=objをつけて黙らせます rustc -O --emit=obj --target wasm32-wasi calc.rs できたcalc.o(wasm)をwatに変換して見てみる # wasm2wat calc.o
(module (type (;0;) (func (param i64 i32) (result i32))) (import "env" "__linear_memory" (memory (;0;) 0)) (import "env" "read" (func (;0;) (type 0))) (func $calc (type 0) (param i64 i32) (result i32) local.get 0 i32.const 2 call 0 local.get 1 i32.const 255 i32.and i32.add)) これでできてる気がしますが, exportがないのでランタイムからcalcを呼べません. コンパイラくんにexportを付与してもらう方法が, 分からなかったので無理やりつけます. wasm2wat calc.o | sed '$ s/)$/\(export "calc" \(func $calc\)\)\)/' > tmp.wat
wat2wasm tmp.wat -o calc.wasm wasm2watとwat2wasmは, wabt にあります.

